const _hoisted_28 = /* @__PURE__ */ createStaticVNode('<p>Index tables can also:</p><ul><li>Support <a href="/polaris-vue/components/ResourceItem">customized index rows and columns</a></li><li>Include bulk actions so merchants can act on multiple objects at once</li><li>Support sorting and <a href="/polaris-vue/components/Filters">filtering</a> of long lists</li><li>Be paired with pagination to make long lists digestible</li></ul><hr><h2 id="build" tabindex="-1">Build <a class="header-anchor" href="#build" aria-label="Permalink to &quot;Build&quot;">â€‹</a></h2><p>Using an index table in a project involves combining the following components and subcomponents:</p><ul><li>IndexTable</li><li><a href="#index-table-row">IndexTableRow</a></li><li><a href="#index-table-cell">IndexTableCell</a></li><li><a href="/polaris-vue/components/Filters">Filters</a> (optional)</li><li><a href="/polaris-vue/components/IndexFilters">IndexFilters</a> (optional)</li><li><a href="/polaris-vue/components/Pagination">Pagination</a> (optional)</li></ul><p>The index table component provides the UI elements for list selection, sorting, filtering, and pagination, but doesnâ€™t provide the logic for these operations. When a sort option is changed, filter added, or second page requested, youâ€™ll need to handle that event (including any network requests) and then update the component with new props.</p><hr><h2 id="purpose" tabindex="-1">Purpose <a class="header-anchor" href="#purpose" aria-label="Permalink to &quot;Purpose&quot;">â€‹</a></h2><p>Shopify is organized around objects that represent merchants&#39; businesses, like customers, products, and orders. Each individual order, for example, is given a dedicated page that can be linked to. In Shopify, we call these types of objects <em>resources</em>, and we call the objectâ€™s dedicated page its <em>details page</em>.</p><h3 id="problem" tabindex="-1">Problem <a class="header-anchor" href="#problem" aria-label="Permalink to &quot;Problem&quot;">â€‹</a></h3><p>Take orders as an example. Merchants may have a lot of them. They need a way to scan their orders, view the different attributes on each order, and find out which ones need action first. In other words, they need a way find an individual order, call up more information about it, and take action on it.</p><h3 id="solution" tabindex="-1">Solution <a class="header-anchor" href="#solution" aria-label="Permalink to &quot;Solution&quot;">â€‹</a></h3><p>Index tables function as:</p><ul><li>A content format, presenting a set of individual resources with multiple columns of information for each</li><li>A system for taking action on one or more individual resources</li><li>A way to navigate to an individual resourceâ€™s details page</li></ul><p>Because a details page displays all the content and actions for an individual resource, you can think of a resource list as a summary of these details pages. In this way resource lists bridge a middle level in Shopifyâ€™s navigation hierarchy.</p><hr><h2 id="best-practices" tabindex="-1">Best practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to &quot;Best practices&quot;">â€‹</a></h2><p>Index tables should:</p><ul><li>Have items that perform an action when clicked. The action should navigate to the resourceâ€™s details page or otherwise provide more detail about the item.</li><li><a href="/polaris-vue/components/ResourceItem">Customize the content and layout</a> of their items rows to surface information to support merchantsâ€™ needs.</li><li>Support sorting if the list can be long, and especially if different merchant tasks benefit from different sort orders.</li><li>Support <a href="/polaris-vue/components/Filters">filtering</a> if the list can be long.</li><li>Paginate when the current list contains more than 50 items.</li><li>Use the <a href="/polaris-vue/components/SkeletonPage">skeleton page</a> component on initial page load for the rest of the page if the loading prop is true and items are processing.</li><li>Numeric cells and titles should be right aligned with the <a href="/polaris-vue/components/Text">Text</a> component</li><li>Numeric cells should use the numeric style with the <a href="/polaris-vue/components/Text">Text</a> component</li></ul><p>Index tables can optionally:</p><ul><li>Provide bulk actions for tasks that are often applied to many list items at once. For example, merchants may want to add the same tag to a large number of products.</li><li>Hide bulk actions on small screens using the <code>condensed</code> prop. We only recommend hiding bulk actions on screens smaller than 490px using our <code>breakpoints-sm</code> value: <code>condensed={useBreakpoints().smDown}</code>. <ul><li>Hiding bulk actions means a merchant canâ€™t select multiple items at once, so it should only be used when the bulk actions are not essential to the merchantâ€™s workflow.</li></ul></li></ul><hr><h2 id="content-guidelines" tabindex="-1">Content guidelines <a class="header-anchor" href="#content-guidelines" aria-label="Permalink to &quot;Content guidelines&quot;">â€‹</a></h2><p>Index tables should:</p><ul><li>Identify the type of resource, usually with a heading</li></ul>', 26);
